var n=(0,e.createTemplateFactory)({id:"49o0KC2m",block:'[[[10,0],[14,0,"prose"],[12],[1,"\\n"],[10,"h1"],[14,1,"introduction"],[12],[10,3],[14,6,"#introduction"],[12],[1,"Introduction"],[13],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"my-6 font-serif prose"],[12],[1,"\\n"],[10,"blockquote"],[14,0,"mb-4"],[12],[1,"\\n  "],[10,0],[14,0,"relative mx-4 text-serif text-large-1"],[12],[1,"\\n    "],[1,[28,[35,0],["quote"],[["class"],["absolute top-0 left-0 w-12 h-12 text-gray-200 opacity-80 transform -translate-x-3 -translate-y-4"]]]],[1,"\\n    "],[10,0],[14,0,"relative my-5 lg:text-lg"],[12],[1,"\\n      "],[10,1],[12],[1,"\\n        There are three things that are certain with any software development\\n        project:\\n      "],[13],[1,"\\n      "],[10,"ol"],[12],[1,"\\n        "],[10,"li"],[12],[1,"\\n          A complete and consistent set of requirements will not be captured\\n          before the design and coding starts.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n          The requirements will change during the lifetime of the project.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n          The user interface is more likely to change than any other part of the\\n          system.\\n        "],[13],[1,"\\n      "],[13],[1,"\\n    "],[13],[1,"\\n  "],[13],[1,"\\n  "],[10,0],[14,0,"flex ml-12 -mt-3"],[12],[1,"\\n    "],[10,0],[14,0,"text-grey-light"],[12],[1,""],[13],[1,"\\n    "],[10,3],[14,6,"#horrocks"],[14,0,"ml-2 md__a"],[12],[1,"Ian Horrocks, Constructing the User Interface with Statecharts"],[13],[1,"\\n  "],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"prose"],[12],[1,"\\n"],[10,2],[12],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," has been created to "],[10,"strong"],[12],[1,"address many of the difficulties"],[13],[1," of client-side application development. Even with an ambitious framework like "],[10,"code"],[12],[1,"Ember.js"],[13],[1,", "],[10,"strong"],[12],[1,"client-side application development can get very complex"],[13],[1," and there are several reasons for this being the case:"],[13],[1,"\\n"],[10,"ul"],[12],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"client-side apps are stateful"],[13],[1," - client-side apps are a system that allows users to request data from someplace and manipulate it entirely on the user\'s client device. Application developers\' job is to manage the UI-state created by the user interacting with the requested data in their applications and make sure to always display the correct representation of that state to their users."],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"We are building complex reactive systems"],[13],[1," because the representation of client-side state has to "],[10,"strong"],[12],[1,"react continuously to internal and external events"],[13],[1,":"],[13],[1,"\\n"],[10,"ul"],[12],[1,"\\n"],[10,"li"],[12],[10,"strong"],[12],[1,"Internal events"],[13],[1," - events triggered by the user like clicks, text input etc."],[13],[1,"\\n"],[10,"li"],[12],[10,"strong"],[12],[1,"External events"],[13],[1," - events triggered by the outside like server responses, web-socket push-events or timers firing."],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"Modeling this behavior is very complex if not done explicitly"],[13],[1,". The usual way to develop client-side applications though is implicit. Developers usually develop code in an ad-hoc fashion by setting properties based on "],[10,"code"],[12],[1,"actions"],[13],[1," on components and other objects that can hold state. This implicit modeling breaks down fast even for medium-level complexity. Components that implement their behavior implicitly are hard to reason about, hard to maintain, and hard to extend. "],[10,3],[14,6,"#horrocks"],[12],[1,"[Horrocks 99]"],[13],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"Discussing behavior is very difficult with other stakeholders"],[13],[1,". There\'s no shared language between developers, designers, and other stakeholders like product owners. Thus "],[10,"strong"],[12],[1,"a lot of requirements are left unidentified in the requirements phase"],[13],[1," of a development iteration - "],[10,"em"],[12],[1,"loading-states"],[13],[1," are often forgotten and nobody on the team really can answer questions about how the application should behave when certain events have happened in the application lifecycle - "],[10,"em"],[12],[1,"\\"What happens when the user loses the server connection during upload?\\""],[13],[1," and similar are questions that come up during development but not before. This leads to "],[10,"strong"],[12],[1,"frustration on teams and missed deadlines"],[13],[1," because so much of the implicit requirements have not been accounted for during the planning phase."],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,"h2"],[14,1,"statecharts-to-the-rescue"],[12],[10,3],[14,6,"#statecharts-to-the-rescue"],[12],[1,"Statecharts to the rescue"],[13],[13],[1,"\\n"],[10,2],[12],[1,"A way to deal with the difficulties of  client-side application development is to "],[10,"strong"],[12],[1,"use "],[10,"code"],[12],[1,"statecharts"],[13],[1," to model your application\'s behaviors explicitly"],[13],[1,":"],[13],[1,"\\n"],[10,"ul"],[12],[1,"\\n"],[10,"li"],[12],[1,"The literature has been conclusive in that dynamic "],[10,"strong"],[12],[1,"complex behavior is best modeled as a set of states that react to events"],[13],[1," - statecharts are a way of modeling behavior explicitly in a scalable way even for the most complex behaviors. "],[10,3],[14,6,"#harel"],[12],[1,"[Harel 87]"],[13],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"font-serif prose"],[12],[1,"\\n"],[10,"blockquote"],[14,0,"mb-4"],[12],[1,"\\n    "],[10,0],[14,0,"relative mx-4 text-serif text-large-1"],[12],[1,"\\n    "],[1,[28,[35,0],["quote"],[["class"],["absolute top-0 left-0 w-12 h-12 text-gray-200 opacity-80 transform -translate-x-3 -translate-y-4"]]]],[1,"\\n    "],[10,0],[14,0,"relative my-5 lg:text-lg"],[12],[1,"\\n      The behavior of a reactive system is really the set of allowed sequences of\\n      input and output events, conditions, and actions, perhaps with some additional\\n      information such as timing constraints.\\n    "],[13],[1,"\\n  "],[13],[1,"\\n  "],[10,0],[14,0,"flex ml-12 -mt-3"],[12],[1,"\\n    "],[10,0],[14,0,"text-grey-light"],[12],[1,""],[13],[1,"\\n    "],[10,3],[14,6,"#harel"],[14,0,"ml-2 md__a"],[12],[1,"David Harel, Statecharts: a visual formalism for complex systems"],[13],[1,"\\n  "],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"prose"],[12],[1,"\\n"],[10,"ul"],[12],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"Statecharts can be modeled explicitly and are executable"],[13],[1,".  Instead of relying on implicit state management, you "],[10,"em"],[12],[1,"model"],[13],[1," behavior as an executable statechart configuration that makes it impossible for your application to behave in unexpected ways."],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"With Statecharts it is easy to understand and change existing behavior"],[13],[1,". Statecharts are easy to reason about, refine and maintain because states in statecharts can be extended and nested."],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[1,"In addition to explicitly modeling behavior "],[10,"strong"],[12],[1,"statecharts can be used to visualize modeled behavior"],[13],[1," and can thus be used to close a gap in client-side application development today where it is hard to discuss application behavior with other stakeholders. Statecharts can be used as an "],[10,"strong"],[12],[1,"easy-to-understand shared language between stakeholders"],[13],[1," - designers, product owners, and developers."],[13],[1,"\\n"],[13],[1,"\\n"],[10,"li"],[12],[1,"\\n"],[10,2],[12],[1,"Statecharts can be used as a "],[10,"strong"],[12],[1,"modeling tool"],[13],[1," in the requirements phase, as an "],[10,"strong"],[12],[1,"implementation tool"],[13],[1," in the coding phase, and as a debugging and "],[10,"strong"],[12],[1,"documentation tool"],[13],[1," in the production phase of your application."],[13],[1,"\\n"],[13],[1,"\\n"],[13],[1,"\\n"],[10,"h2"],[14,1,"documenting-behavior"],[12],[10,3],[14,6,"#documenting-behavior"],[12],[1,"Documenting behavior"],[13],[13],[1,"\\n"],[10,2],[12],[1,"Modeling your application behavior explicitly via "],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," will give you documentation\\nof your application behavior for free. Statecharts can be visualized via the "],[10,3],[14,6,"https://xstate.js.org/viz/"],[12],[1,"XState-visualizer"],[13],[1,"\\nand you will have an easier time understanding components and user-flows by looking at them."],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"my-12 prose"],[12],[1,"\\n  "],[10,"figure"],[12],[1,"\\n    "],[10,"iframe"],[14,"src","https://xstate.js.org/viz/?gist=1b7e330cb49ccc3367b293651fa89377&embed=1"],[14,0,"w-full my-12 border h-128 rounded-md prose"],[12],[1,"\\n    "],[13],[1,"\\n    "],[10,"figcaption"],[12],[1,"\\n      "],[10,1],[14,0,"align-middle"],[12],[1,"An example of a statechart modeling button behavior in the "],[13],[1,"\\n      "],[10,3],[14,6,"https://xstate.js.org/viz/"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[14,0,"hover:text-gray-700"],[12],[1,"\\n        "],[1,[28,[35,0],["xstate"],[["class"],["inline w-16 h-8 align-middle fill-current"]]]],[1,"\\n        "],[10,1],[14,0,"align-middle"],[12],[1,"visualizer"],[13],[1,"\\n      "],[13],[1,"\\n    "],[13],[1,"\\n  "],[13],[1,"\\n"],[13],[1,"\\n"],[10,0],[14,0,"prose"],[12],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[1,"Visualizing statecharts also allows you to communicate about behavior\\nwith other stakeholders"],[13],[1," - designers, product owners, and fellow developers. Because you\\nare modeling behavior explicitly with an executable statechart in your code there is\\nnow "],[10,"strong"],[12],[1,"always up-to-date documentation"],[13],[1," of how components and other parts of your app behave."],[13],[1,"\\n"],[10,2],[12],[1,"You can step through your behavior with the "],[10,3],[14,6,"https://xstate.js.org/viz/"],[12],[1,"XState-visualizer"],[13],[1," and have discussions\\nabout how your application behaves based on a visual language that everyone understands."],[13],[1,"\\n"],[10,"h2"],[14,1,"powered-by-xstate"],[12],[10,3],[14,6,"#powered-by-xstate"],[12],[1,"Powered by XState"],[13],[13],[1,"\\n"],[10,2],[12],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," provides a small Ember.js-specific wrapper around the fabulous\\nand widely-used "],[10,3],[14,6,"https://xstate.js.org/docs/"],[12],[1,"XState"],[13],[1,"-library. All of the  powerful\\nfeatures of "],[10,"code"],[12],[1,"XState"],[13],[1," are supported. The purpose of "],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," is to\\nmake it easy to use "],[10,"code"],[12],[1,"XState"],[13],[1," in an Ember.js application without having\\nto write the same boilerplate code over and over again."],[13],[1,"\\n"],[10,"h2"],[14,1,"ember-statecharts-vs-ember-concurrency"],[12],[10,3],[14,6,"#ember-statecharts-vs-ember-concurrency"],[12],[1,"ember-statecharts vs. ember-concurrency"],[13],[13],[1,"\\n"],[10,2],[12],[10,"strong"],[12],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," is not a contender to "],[10,"code"],[12],[1,"ember-concurrency"],[13],[13],[1,". Both addons can be used\\nin combination. "],[10,"code"],[12],[1,"ember-concurrency"],[13],[1," gives you a clean API to handle async interactions in\\nyour code and will handle cleanup when components are destroyed. After modeling\\nthe states in your components explicitly for some time you might even come to the conclusion\\nthat the reason why "],[10,"code"],[12],[1,"ember-concurrency"],[13],[1," is so great is that it models async interactions\\nexplicitly. But async interactions with APIs are not the only complex reactive behavior you will\\nwant to model in your applications explicitly. If you want to model a complex sign-up flow for example\\nit might include async interaction with your backend API but you will still want to model\\nthe rest of the sign-up flow explicitly and "],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," will help you with that."],[13],[1,"\\n"],[10,2],[12],[1,"Generally speaking "],[10,"code"],[12],[1,"ember-statecharts"],[13],[1," can do all the things "],[10,"code"],[12],[1,"ember-concurrency"],[13],[1," can do, but not the other way around.\\nIf you so desire, you can continue using "],[10,"code"],[12],[1,"ember-concurrency"],[13],[1," in combination with "],[10,"code"],[12],[1,"ember-statecharts"],[13],[1,", but you will be surprised how far "],[10,3],[14,6,"https://xstate.js.org/docs/guides/communication.html#invoking-promises"],[12],[1,"XState\'s invoking promises feature"],[13],[1," will get you."],[13],[1,"\\n"],[10,"h2"],[14,1,"references"],[12],[10,3],[14,6,"#references"],[12],[1,"References"],[13],[13],[1,"\\n"],[10,2],[12],[10,3],[14,6,"https://www.sciencedirect.com/science/article/pii/0167642387900359"],[12],[10,3],[14,3,"harel"],[12],[1,"[Harel 87]"],[13],[1," D. Harel, Statecharts: a visual formalism for complex systems, Science of Computer Programming, Volume 8, Issue 3, June 1987, Pages 231-274"],[13],[13],[1,"\\n"],[10,2],[12],[10,3],[14,6,"https://books.google.no/books/about/Constructing_the_User_Interface_with_Sta.html?id=-9VQAAAAMAAJ&redir_esc=y&hl=en"],[12],[10,3],[14,3,"horrocks"],[12],[1,"[Horrocks 99]"],[13],[1," I. Horrocks, Constructing the User Interface with Statecharts, Addison-Wesley, 1999"],[13],[13],[1,"\\n"],[13]],[],false,["svg-jar"]]',moduleName:"site/templates/docs/index.hbs",isStrictMode:!1})
